import React, { Fragment } from "react";
import './home.css';
import Navbar from "./navbar";
import notiIcon from '../images/icons8-notifications-64.png'
import settingsicon from '../'

const Dashboard = () => {
    return (
        <Fragment>
            <div className="div_main_dashboard">
                <div className="div_navbar_dashboard">
                    <Navbar />
                </div>
                <div className="dashboard_header_container">
                    <header className="dashboard_header">
                        <h1>Dashboard</h1>
                        <div className="header_buttons">
                            <button className="header_button">
                                <img src="path/to/your/image1.png" alt="Button 1" />
                            </button>
                            <button className="header_button">
                                <img src="path/to/your/image2.png" alt="Button 2" />
                            </button>
                        </div>
                    </header>
                </div>
                {/* Other dashboard content can go here */}
            </div>
        </Fragment>
    );
}

export default Dashboard;
